import React from 'react'

export const KeyRend = () => {
    let fruits=["apple","pineapple","mango","watermelon","apple"]
  return (
    <div>
        {
            fruits.map((fruit,index)=>{
                return <h1 key={index+1}>{index}.{fruit}</h1>
            })
        }
    </div>
  )
}
